import React from 'react';

const DashboardStudentsTable = () => {
  const students = [
    { name: 'Abinash Shasthin', id: '801', batch: 'BBI', grade: 'B+', year: '2024' },
    { name: 'Kawsar Shasthin', id: '802', batch: 'BBI', grade: 'B+', year: '2024' },
  ];

  return (
    <div className="mt-6 bg-white rounded-lg shadow-sm border border-gray-200">
      <div className="p-4">
        <h3 className="text-sm font-semibold text-gray-900 mb-4">Students</h3>
        <div className="overflow-x-auto">
          <table className="w-full text-sm">
            <thead>
              <tr className="border-b border-gray-200">
                <th className="text-left py-2 px-3 font-medium text-gray-700 text-xs">ID</th>
                <th className="text-left py-2 px-3 font-medium text-gray-700 text-xs">Name/Student</th>
                <th className="text-left py-2 px-3 font-medium text-gray-700 text-xs">Batch</th>
                <th className="text-left py-2 px-3 font-medium text-gray-700 text-xs">Grade</th>
                <th className="text-left py-2 px-3 font-medium text-gray-700 text-xs">Year</th>
              </tr>
            </thead>
            <tbody>
              {students.map((student, index) => (
                <tr key={index} className="border-b border-gray-100 hover:bg-gray-50">
                  <td className="py-2 px-3 text-xs text-gray-700">{student.id}</td>
                  <td className="py-2 px-3 text-xs text-gray-900 font-medium">{student.name}</td>
                  <td className="py-2 px-3 text-xs text-gray-700">{student.batch}</td>
                  <td className="py-2 px-3 text-xs text-gray-700">{student.grade}</td>
                  <td className="py-2 px-3 text-xs text-gray-700">{student.year}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default DashboardStudentsTable;
